import useData from "./common/hooks/useData";
import Header from "./components/Header";

const App = () => {
  const { user } = useData();

  if (user === undefined) {
    return (
      <main className="min-h-screen min-w-screen flex justify-center items-center text-2xl">
        No token provided.
      </main>
    );
  }

  if (user === null) {
    return (
      <main className="min-h-screen min-w-screen flex justify-center items-center text-2xl">
        No token provided.
      </main>
    );
  }

  return <Header />;
};

export default App;
